<li>
<p>面向对象的配置：由于配置被定义为 JavaConfig 中的类，因此用户可以充分利用 Java 中面向对象功能。一个配置类可以继承另一个，从写它的 @Bean 方法等。</p>
</li>
<li>
<p>减少或消除 XML 配置：基于依赖注入原则的外化配置的好处已经被证明，但是，许多开发人员不希望在 XML 和 Java 之间来回切换。JavaConfig 为开发人员提供了一种纯 java 方法来配置与 XML 配置概念相似的 Spring 容器。从技术的角度来讲，只使用 JavaConfig 配置类来配置容器是可行的，但实际上很多人认为将 JavaConfig 和 XML 混合匹配时理想的。</p>
