<p>隐藏对象内部的复杂性，只对外公开简单的接口。便于外界的调用，从而提高系统的可扩展性、可维护性。通俗的讲把该隐藏的隐藏起来，该暴露的暴露出来。我们将类的属性私有化 (private)，同时提供 公共的(public) 方法 获取(getXXX) 和 设置(setXXX) 值。不对外暴露私有的方法。</p>
